(function(){const StylesheetURLs=new Set();const JSONP_CALLBACK_PREFIX='_gistEmbedJSONP_';let _jsonpCallbackIDCounter=0;const GIST_URL_PREFIX='https://gist.github.com/';const GIST_ID_ATTRIBUTE_NAME='data-gist-id';if(document.attachEvent?document.readyState==='complete':document.readyState!=='loading'){init()}else{document.addEventListener('DOMContentLoaded',init)}
function init(){Array.from(getAllGistEmbedDOMNodes()).forEach(fetchJSONPForGistEmbedDOMNode)}
function getAllGistEmbedDOMNodes(){return document.querySelectorAll(`[${GIST_ID_ATTRIBUTE_NAME}]`)}
function generateJSONPCallbackPrefix(){++_jsonpCallbackIDCounter;return `${JSONP_CALLBACK_PREFIX}${_jsonpCallbackIDCounter}`}
function appendStylesheet(stylesheetURL){if(!StylesheetURLs.has(stylesheetURL)){StylesheetURLs.add(stylesheetURL);const linkEl=document.createElement('link');linkEl.setAttribute('href',stylesheetURL);linkEl.setAttribute('type','text/css');linkEl.setAttribute('rel','stylesheet');document.body.appendChild(linkEl)}}
function getJSONP(gistID,callback){const callbackName=generateJSONPCallbackPrefix();window[callbackName]=callback;const scriptEl=document.createElement('script');scriptEl.setAttribute('src',`${GIST_URL_PREFIX}${gistID}.json?callback=${callbackName}`);document.body.appendChild(scriptEl)}
function fetchJSONPForGistEmbedDOMNode(gistDOMNode){const gistID=gistDOMNode.getAttribute(GIST_ID_ATTRIBUTE_NAME);function callback(response){if(Boolean(response)&&Boolean(response.div)&&Boolean(response.stylesheet)){handleJSONPResponseForDOMNode(gistDOMNode,response)}}
if(Boolean(gistID)){getJSONP(gistID,callback)}}
function handleJSONPResponseForDOMNode(gistDOMNode,response){appendStylesheet(response.stylesheet);gistDOMNode.innerHTML=response.div}})()